import './inputs.css'

const Searching = ({
  filterText,
  filterTextChange
}) => {
  return (
    <form className='form'>
      <input 
      type='text'
      value={filterText} 
      placeholder='Hae laitetta' 
      onChange={(e) => filterTextChange(e.target.value)}
      className="btn"/>
    </form>
  )
}

export default Searching
